import React from "react";
import logo from "../images/photoDeux.png";
const Box = props => {
  return (
    <div className="container">
      <div className="row">
        {props.essai.map(myCard => {
          return (
            <div
              key={myCard.id}
              className="card col-xxl col-lg-12 col-md-12"
              style={{ width: "18rem" }}
            ></div>
          );
        })}
      </div>
    </div>
  );
};

export default Box;
